import { useParams } from 'react-router-dom';

function CategoryDescription() {
    let cateName = useParams()
    return (
        <>
            <div>
                <a href="/">Назад</a>
                <h1> Category: {cateName} </h1>
            </div>
        </>
    );
}

export default CategoryDescription;
